import {useState} from "react";
const MyForm =()=>{

    const [name,setName]= useState("");
    const [skill,setSkill]= useState("");

    return(
        <form>
            <h1>ADD FORM</h1>
            <h2>Current Value:{name}</h2>
            <div>
                <label htmlFor="inputName">Enter any name:</label>
                <input type="text" id="name" onChange={(e)=> setName(e.target.value)} 
                value={name}></input>
            </div>
            {(name.length)}
            <div>
                <label htmlFor="skillLevel">Enter any skill level:</label>
                <input type="text" id="skill" onChange={(e)=> setName(e.target.value)} 
                value={name}></input>
            </div>
            {}
            
        </form>
    )
}

export default MyForm;
